Maravilhoso Loft em Pinheiros-
Ambiente de estar/jantar/circulação, integrado ao espaço dormitório/suíte podendo ser separados com divisórias leves ou mesmo parede de alvenaria;
Cozinha com portas para terraço e living;
Com banheiro e lavabo;
Amplo Terraço com churrasqueira,  pia, tanque cerâmico, e espaço para lavadoura.
Projeto padrão do fechamento do terraço com vidros e cortinas;
Fechadura com leitor biométrico, inclusive com comando à distância;
Automação wireless para criação de cenas de iluminação;
Face norte, ensolarado, bem ventilado, e com boa distância dos prédios vizinhos.
Características do prédio
Espaço gourmet com churrasqueira e forno de pizza;
Fitness decorado e equipado
Lavanderia;
Lounge e portaria já decorados por João Armentano e Estela Sokol.
