Piscina infantil
Playground e Praça do Playground;
Praça de entrada;
Portarias ?pulmão ?, blindadas e com 3 portões,  para entrada de veículos, visitantes e correspondências.
Solarium Lobby com pé direito duplo e obra de Estela Sokol;
Gerador para elevador e áreas comuns.
Enfim, um prédio novo,  com tudo que existe de mais atualizado.

A loja foi reformada: todo o cabeamento de elétrica, as luminárias e os sistemas de porta de enrolar foram substituídos, o piso de granilite foi polido, foi instalado carpete de madeira no mezanino e no 1º andar, e as paredes foram pintadas.
